from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    if not triples:
        return sentence

    subject = triples[0].subject
    sentence += f"{subject} "

    for i, triple in enumerate(triples):
        if i == 0:
            if triple.predicate == "architecturalStyle":
                sentence += f"is built in {triple.object} style. "
            elif triple.predicate == "buildingStartDate":
                sentence += f"was started in {triple.object}. "
            else:
                sentence += f"has a {triple.predicate} of {triple.object}. "
        else:
            if triple.predicate == "country":
                sentence += f"which is in {triple.object}. "
            elif triple.predicate == "capital":
                sentence += f"where the capital is {triple.object}. "
            elif triple.predicate == "location":
                sentence += f"and is located in {triple.object}. "
            else:
                sentence += f"and also has a {triple.predicate} of {triple.object}. "

    return sentence

